import logo from '../imgs/logo192.png'
import TextoAnimado from '../animações/TextoAnimado'
function InitialPage() {
  return (
    <div id= "initial-page">
      <div id= "initial-page-marca" >
        <img src={logo} alt="logo da Easy Sites Brasil" />
        <TextoAnimado/>
      </div>

      <h1 id = "main-text-home">Crie seu site com a gente!</h1>
      <button>Quero um site</button>
    </div>
  );
}

export default InitialPage;
